dialogue.278:
Explainer: So the side channel analysis is really looking not at a vulnerability within a system, but really unintended consequences of what the system is built on. A very simple example of a side channel is putting your ear to the ground to hear if there are horses coming towards you, and the same thing applies to technology. So you can have something like a CPU, it's executing instructions, certain instructions that use a little bit more power, and power is reserved in these capacitors, which are like tiny batteries next to your CPU. And as they're pulling power, there's something in physics called the electrostrictive effect where the capacitor will move in a very, very tiny amount. And then although we can't hear it, the microphone on a mobile device can actually listen to that. If you then listen to that and you say, oh, I see a pattern here, and you can go all the way down and then extract and reveal the full password, the full key, even though it could be argued that the algorithm itself, there's no problem with it.
Explainee: So all memory devices are just, it's just a bunch of gates and they're in rows. They basically all hold different pieces of memory. That's all the gates are. Either they're turned on or they're turned off. So what Rowhammer found was they tested a bunch of different memory devices and found that by doing a certain order of storing things, and then pulling that information back in a certain way in one place would actually flip gates in a different place. So you could actually do a bunch of things to a piece of memory that had nothing to do with something that may be critical in a different place and actually change its contents, and that obviously exposes all sorts of security issues, because that's very hard to predict.
